import React from 'react';
import './counter.css';

class Counter extends React.Component {
    state = {
        counterValue: 0,
    }
    render() {
        return(
            <div className="counter">
                Licznik:
                <span className="value">{this.state.counterValue}</span>
            </div>
        )
    }
};

export default Counter;
